import React from 'react' ;

const { render } = require("@testing-library/react")

class Clock extends React.Component{
    constructor(props){
        super(props);
        this.state = {date: new Date()};
    }
    render(){
        return(<div>
            <h2>Time now  {this.props.state.date.toLocalTimeString()}.</h2>
          </div>);

    }
}

export default Clock;
